import React from 'react';
import VerticalNavBar from './VerticalNavBar';
import './App.css';
import PortfolioSite from './PortfolioSite';

function App() {

  sections = [];

  return (
    <div className="App">
      <VerticalNavBar/>
      <PortfolioSite sections={sections} />
      <div className="intro-text">Hi there! I'm Laura.</div>
    </div>
  );
}

export default App;
